import React from "react";
import styled from "styled-components";
import TextField from "@mui/material/TextField";
import Button from "@mui/material/Button";

const Wrapper = styled.section`
  .footer {
    .left {
      display: flex;
      justify-content: center;
      align-items: center;
      padding: 10% 5%;
      flex-wrap: wrap;
      gap: 10%;
      @media (min-width: 768px) {
        gap: 5%;
        padding: 5%;
      }
      .div {
        display: flex;
        justify-content: center;
        align-items: flex-start;
        flex-direction: row;
        gap: 5%;
        margin-bottom: 30%;
        @media (min-width: 568px) {
          gap: 10%;
        }
        @media (min-width: 768px) {
          flex-direction: column;
          margin-bottom: 0%;
          gap: 20%;
          width: 28%;
        }
        .text {
          display: grid;
          gap: 20%;
          text-align: center;
          @media (min-width: 768px) {
            margin-top: 100%;
          }
          a {
            color: #000;
            font-size: 18px;
            @media (min-width: 768px) {
              font-size: 16px;
              text-align: left;
              letter-spacing: 1px;
            }
          }
          .head {
            font-size: 20px;
            line-height: 30px;
            font-weight: 800;
            @media (min-width: 768px) {
              font-size: 19px;
            }
          }
        }
        .text1 {
          width: 80%;
          @media (min-width: 768px) {
            margin-top: 0%;
          }
        }
      }

      .div {
        .text {
          @media (min-width: 768px) {
            margin-top: 45%;
            margin-bottom: 35%;
          }
        }
        .text1 {
          width: 80%;
          @media (min-width: 768px) {
            margin-top: 0%;
          }
        }
      }
      .div2 {
        .text {
          @media (min-width: 768px) {
            width: 33%;
            .head {
              font-size: 21px;
            }
            margin-top: 70%;
            margin-bottom: 35%;
          }
        }
        .text1 {
          width: 80%;
          @media (min-width: 768px) {
            margin-top: 0%;
          }
        }
      }
      .div3 {
        .text {
          @media (min-width: 768px) {
            margin-top: 50%;
          }
        }
        .text1 {
          width: 80%;
          @media (min-width: 768px) {
            margin-top: 0%;
          }
        }
      }
    }
    .right {
      margin-top: 5%;
      background-color: #f2f3ff;
      padding: 7% 5% 20% 5%;
      display: grid;
      gap: 5%;
      text-align: center;
      @media (min-width: 568px) {
        padding: 7% 5% 13% 5%;
      }
      h2 {
        font-size: 35px;
        font-weight: 800;
        @media (min-width: 568px) {
          text-align: left;
        }
      }
      span {
        font-size: 19px;
        line-height: 25px;
        font-weight: 400;
        margin-top: 10%;
        @media (min-width: 568px) {
          margin-top: 7%;
        }
      }
      form {
        .textfield {
          width: 100%;
        }
        .button {
          float: right;
          margin-top: 5%;
        }
      }
    }
  }
`;

function Footer() {
  return (
    <Wrapper>
      <div className="footer">
        <div className="left">
          <div className="div">
            <div className="text text1">
              <a href="#" className="head">
                Make a Donation
              </a>
              <a href="#">monthly donors</a>
              <a href="#">support a student</a>
              <a href="#"> general</a>
            </div>
            <div className="text">
              <a href="#" className="head">
                Uncommon Notes
              </a>

              <a href="#">blog</a>
              <a href="#">our story</a>
            </div>
          </div>
          <div className="div div2">
            <div className="text text1">
              <a href="#" className="head">
                Get Involved
              </a>
              <a href="#">build / sponsor</a>
              <a href="#">hire uncommon</a>
              <a href="#">donate hardware</a>
            </div>
            <div className="text">
              <a href="#" className="head">
                Contact Us
              </a>

              <a href="#">general</a>
              <a href="#">for dev work</a>
            </div>
          </div>
          <div className="div div3">
            <div className="text text1">
              <a href="#" className="head">
                Volunteer Opportunities
              </a>

              <a href="#">mentorship</a>
              <a href="#">host a dinner</a>
              <a href="#">ambassadors</a>
            </div>

            <div className="text">
              <a href="#" className="head">
                Annual Reports
              </a>

              <a href="#">2019</a>
              <a href="#">2020</a>
              <a href="#">2021</a>
              <a href="#">2022</a>
            </div>
          </div>
        </div>

        <div className="right">
          <h2>Get In Touch</h2>
          <form>
            <TextField
              id="standard-basic"
              className="textfield"
              label="Name"
              variant="standard"
            />
            <TextField
              id="standard-basic"
              label="Email Address"
              variant="standard"
              className="textfield"
            />
            <TextField
              id="standard-multiline-static"
              label="Message"
              multiline
              rows={4}
              variant="standard"
              className="message textfield"
            />

            <Button variant="contained" size="large" className="button">
              Submit
            </Button>
          </form>
          <span>copyright 2023 | all rights reserved | uncommon.org</span>
        </div>
      </div>
    </Wrapper>
  );
}

export default Footer;
